import { nanoid } from "nanoid";

const palette = [
  {
    id: nanoid,
    color: "#B9FFF8",
  },
  {
    id: nanoid,
    color: "#DEF5E5",
  },
  {
    id: nanoid,
    color: "#B9E0FF",
  },
  {
    id: nanoid,
    color: "#FFB9B9",
  },
  {
    id: nanoid,
    color: "#B1B2FF",
  },
];

const Palette = () => {
  return (
    <div className="palette-container">
      {palette.map((item) => (
        <div
          className="palette-unit"
          style={{ backgroundColor: item.color }}
        ></div>
      ))}
    </div>
  );
};

export default Palette;
